import React, { Component } from 'react';
import Icon from "@expo/vector-icons/MaterialCommunityIcons";
import { ScrollView, TouchableOpacity } from "react-native-gesture-handler";
import { View, Text, Image, ImageBackground, Linking, Platform, StyleSheet } from "react-native";
import firebase from '../database/firebase';
import { Button, TextInput } from 'react-native-paper';
import auth from '@react-native-firebase/auth';



export default class Home extends React.Component {
  makeCall = () => {

    let phoneNumber = '';

    if (Platform.OS === 'android') {
      phoneNumber = 'tel:${08144707400}';
    } else {
      phoneNumber = 'telprompt:${08144707400}';
    }

    Linking.openURL(phoneNumber);
  };



  constructor() {
    super();
    this.state = { 
      uid: ''
    }
  }

  signOutUser = async () => {
    try {
        await firebase.auth().signOut();
        navigate('Login');
    } catch (e) {
        console.log(e);
    }
}
  signOut = () => {
    firebase.auth().signOut().then(() => {
      this.props.navigation.navigate('Login')
    })
    .catch(error => this.setState({ errorMessage: error.message }))
  }  




  render() {
    this.state = { 
      displayName: firebase.auth().currentUser.displayName,
      uid: firebase.auth().currentUser.uid
    }
    return (
      <View>
      <ImageBackground
        source={require("./images/bg.jpg")}
        style={{ width: "100%", height: "100%", resizeMode:"cover" }}
      >

        <View
          style={{
            flexDirection: "row",
            marginTop: 40,
            alignItems: "center",
            paddingHorizontal: 10,
          }}
        >
          <Icon name="bell" size={30} color="#a2a2db" style={{ width: 30 }} />
          <TouchableOpacity


            >
          </TouchableOpacity>
        </View>

        <View style={{ paddingHorizontal: 40, marginTop: 15 }}>
          <Text
            style={{
              fontSize: 20,
              paddingVertical:10,
              color: "#522289",
              fontFamily: "Roboto",
            }}
          >
            Hello, {this.state.displayName}

          </Text>
          <Button mode="contained" style={{justifyContent:"center", alignContent:"flex-end",borderRadius:20, paddingVertical:2}} onPress={() => this.signOutUser()}>
              logout
            </Button>
          <TextInput
          style={styles.inputStyle}
          placeholder="Location (City)"

        />
        <TextInput
          style={styles.inputStyle}
          placeholder="Phone Number"

        />
        <Text style={{justifyContent:"center", alignContent:"center", paddingVertical:7,color:"#6574CF", fontSize:19}} >
              For Membership
            </Text>
        <TextInput
          style={styles.inputStyle}
          placeholder="Doctors/Hospital information"

        />
        <TextInput
          style={styles.inputStyle}
          placeholder="HMO Provider"

        />
        <TextInput
          style={styles.inputStyle}
          placeholder="Alternative contact (optional)"
        />
        <TextInput
          style={styles.inputStyle}
          placeholder="Medications"
        />   

            <Button mode="contained" style={{justifyContent:"center", alignContent:"center",borderRadius:20, paddingVertical:8, marginTop:12}}>
              Update information
            </Button>

        </View>
      </ImageBackground>
      </View>
    );
  }
}

const styles = StyleSheet.create({
refill:{
  paddingVertical:50,
  alignItems: 'center',
  justifyContent: 'center',
},
})
